const index = () => {
  return (
    <div>
      <Link href="/about">
        <a>About Page</a>
      </Link>
      <Link href="/">
        <a>h Page</a>
      </Link>
      <h1>Welcome to BitzPrice</h1>
    </div>
  )
}

export default index
